import React from 'react'

const MovieOne = ({ data }) => {

    const content = data.list[0].page['content-items'];
    const loading = data.loading;
    const page_title=data.list[0].page.title;
    console.log(content)
    return (
        <div>
            <h4>{page_title}</h4>
            <hr />
            {content.map((items, index)=>{
                return(
                    <div key={index}>
                    <strong>{items.name}</strong><br />
                    <strong>{items['poster-image']}</strong>
                    </div>
                )
            })}

            <pre>
                {JSON.stringify(data)}
            </pre>

        </div>
    )
}

export default MovieOne
